import React, { useEffect, useState } from 'react';
import api from '../api';

const Users = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    api.getUsers().then((response) => setUsers(response.data));
  }, []);

  return <Table users={users} />;
};

export default Users;
